import { useState, useEffect, useContext } from 'react';
import { useHistory } from 'react-router';

import styles from './MyCarCard.moduel.css'
import * as carService from '../../services/carService.js'
import { AuthContext } from '../../context/authContext.js';

function MyCars ({ match }) {

    let userId = match.params.userId;
    const { user } = useContext(AuthContext)
    
    let history = useHistory()
    let [cars, myCars] = useState([]);
    useEffect(() => {
        carService.getMyCars(userId, user.accessToken)
            .then(result => {
                myCars(result)
            })
    }, []);

    return (
        <section className='my-listings-section'>
            <div className='container'>
                <h1>My Cars</h1>
                <div className='row'>
                    {cars.length > 0
                        ? cars.map(x => <HomeCard key={x._id} car={x} />)
                        : <h2 className={styles['no-cars']}>No cars yet</h2>
                    }
                </div>
            </div>
        </section>
    );
}

export default MyCars;
